// Transform raw data into grouped date-wise activity counts
export const getGroupedActivityData = () => {
  const grouped = {}

  groupedActivityData.forEach((item) => {
    // Extract date from timestamp (YYYY-MM-DD)
    const dateStr = item.Created_at.split(" ")[0]

    if (!grouped[dateStr]) {
      grouped[dateStr] = {
        date: dateStr,
        Quiz: 0,
        "Question Paper": 0,
        "Lesson Plan": 0,
      }
    }

    grouped[dateStr][item.Activity_type]++
  })

  // Return as sorted array
  return Object.values(grouped).sort(
    (a, b) => new Date(a.date) - new Date(b.date)
  )
}